import React from 'react';
import './Board.css'; 
import image6 from '../assets/LeilaErhili.jpg';
import image7 from '../assets/MaddieFollosco.jpg';
import image8 from '../assets/IreneChang.jpg';
import image9 from '../assets/SanjnaSood.jpg';




const Board = () => {
  return (
    <div className="board-page">
      <h1 className="board-title">Meet the Board</h1>
      <div className = "allmembers">
        <div className= "Leila">
        <img src={image6} alt="Leila" className="image6" />
        <p>Leila Erhili</p>
        <p>President</p>
        </div>
        <div className= "Maddie">
        <img src={image7} alt="Maddie" className="image7" />
        <p>Maddie Follosco</p>
        <p>Vice President</p>
        </div>
        <div className= "Irene">
        <img src={image8} alt="Irene" className="image8" />
        <p>Irene Change</p>
        <p>Event Coordinator</p>
        </div>
        <div className= "Sanjna">
        <img src={image9} alt="Sanjna" className="image9" />
        <p>Sanjna Sood</p>
        <p>Sectaray</p>
        </div>
      </div>
    </div>
  );
};

export default Board;
